using System.Collections.Generic;\nusing System.Web.Services;\nusing System.Web.UI;\n\nnamespace YourNamespace\n{\n    public partial class MyControl : UserControl\n    {\n        [WebMethod]\n        public static List<string> LookupEntries(string input)\n        {\n            List<string> list = new List<string>();\n            // Query database for list of items..\n            foreach (string item in FullItemList)\n            {\n                if (item.StartsWith(input))\n                {\n                    list.Add(item);\n                }\n            }\n            return list;\n        }\n\n        private static List<string> FullItemList = new List<string>\n        {\n            "Apple", "Banana", "Cherry", "Date", "Elderberry", "Fig", "Grapes"\n        };\n    }\n}